insert  into `acknowledgementmoni`(`agency`,`findings`,`action`,`isRead`,`year`) values (15979,'This is to acknowledge receipt of the 8 projects enrolled in the CY 2016 Online Regional Project Monitoring and Evaluation System.\r\nWe recommend you to change the data type of the following projects from maintained and cumulative to default: \r\n<br/> 1) Establishment of Health Profile of ICCs/IPs, 2) Culture Sensitivity Orientation for Health Workers and Other Stakeholders, and<br/> 3) Assistant to Community \r\nSchool (IP Education and Advocacy Program).','.',1,2016),(23393,'For consideration in the preparation of the CY 2016 RPMES Monitoring PLan','.',1,2016),(25988,'Enrolled 3 programs / projects.','For consideration in the preparation of the CY 2016 Annual Project Monitoring Plan.',1,2016),(27463,'This is to acknowledge receipt of the 26 projects enrolled in the CY 2016 Online Regional Project Monitoring and\r\nEvaluation System under the Social Development Sector.','.',1,2016),(28499,'For feedback to the RPMC during its CY 2016 Second Regular Meeting.','.',1,2016),(9001,'1. 25 projects enrolled under the Environment Sector.\r\n2. Project Nos.: 3; 4; 6; 9; 10-16; 18; 19; 21-24; 26, financial targets do not coincide with physical targets. Please review financial targets so that quarterly financial targets will coincide with quarterly physical targets.\r\n3. Project Nos.: 5; 7; 8; 17; 20; 25, under Brown subsector changed to green for land environs and blue for water environs. Please check and verify if assigned subsectors are appropriate.','N/A',1,2016),(16072,'1. 21 projects enrolled under the Infrastructure and Utilities Sector.\r\n2. Actual date of submission April 4, 2016.','N/A',1,2016),(8515,'This is to acknowledge receipt of the 5 projects enrolled in the CY 2016 Online Regional Project Monitoring and Evaluation System.','.',1,2016),(17344,'This is to acknowledge receipt of the 17 projects enrolled in the CY 2016 Online Regional Project Monitoring and\r\nEvaluation System.','.',1,2016),(8497,'Enrolled 125 programs / projects.','For consideration in the preparation of CY 2016 Annual Project Monitoring Plan.',1,2016),(9902,'This is to acknowledge receipt of the 1 project enrolled in the CY 2016 Online Regional Project Monitoring and\r\nEvaluation System under the Social Development Sector.','.',1,2016),(7044,'For consideration in preparation for CY 2016 RPMES Monitoring Plan','.',1,2016),(23942,'1. Nine (9) projects under Governance Sector enrolled.\r\n2. Financial targets in thousand pesos.','1. Financial targets adjusted.\r\n2. Project #1 data type changed to maintained.\r\n3. Projects #2 to #9 data type changed to default.',1,2016),(8156,'For consideration in the preparation of the CY 2016 RPMES Monitoring Plan','.',1,2016),(1,'This is to acknowledge receipt of the 11 projects enrolled in the CY 2016 Online Regional Project Monitoring and Evaluation\r\nSystem under the Social Development Sector.','.',1,2016),(30155,'fsdadyiasdgiuewu8etyuqwue','fskhdfvsdhfsidfh',1,2016),(242,'This is to acknowledge receipt of the 4 projects enrolled in the CY 2016 Online Regional Project Monitoring and\r\nEvaluation System under the Social Development Sector.','.',1,2016),(17089,'This is to acknowledge receipt of the 2 projects enrolled in the CY 2016 Online Regional Project Monitoring and Evaluation System.','.',1,2016),(27238,'Enrolled 6 main projects (with financial requirements), 15 sub-component projects without financial requirements not included due to inadequate info.','For consideration in the preparation of the CY 2016 Annual Project Monitoring Plan',1,2016),(11671,'This is to acknowledge receipt of the 4 projects enrolled in the CY 2016 eRPMES under the Social Development Sector. We recommend \r\nyou to change the data type of the following projects from maintained to default: 1.) Special Program for the Employment of Students, \r\n2.) DOLE Integrated Livelihood and Emergency Employment Program, and 3.) Labor Laws Compliance System.','.',1,2016),(12712,'For consideration in the CY 2016 RPMES Project Monitoring Plan','.',1,2016),(8034,'This is to acknowledge receipt of the 20 projects enrolled in the CY 2016 Online Regional Project Monitoring and\r\nEvaluation System under the Social Development Sector. We recommend you to change the data type of the following\r\nprojects from maintained to default:\r\n1.) Maternal Neonatal & Child Health Nutrition,\r\n2.) National Tuberculosis Program,\r\n3.) Family Planning Program, and\r\n4.) Dengue Control Program','.',1,2016),(15959,'Enrolled 27 programs / projects.','For consideration in the preparation of the CY 2016 Annual Project Monitoring Plan.\r\n',1,2016),(27056,'This is to acknowledge receipt of the 13 projects enrolled in the CY 2016 Online Regional Project Monitoring and Evaluation System.\r\nWe recommend you to review the data inputted and data type used on the following infrastructure projects: </br>\r\n1. Elevation of Concrete Slab and Tile Provision of Dietary Area</br>\r\n2. Construction and Rehabilitation of Hospital Drainage including Provision of Steel Grating at Hospital Rear Perimeter Fence</br>\r\n3. Renovation and Repair of Out Patient Department Waiting Area</br>\r\n4. Repair and Replacement of Roofing Materials of Out Patient Department Building</br>\r\n5. Renovation of Hospital Facade and Lobby</br>\r\n6. Extension of Budget Office and Finance Division</br>\r\n7. Construction of Ramp of OB Surgery Ward Building</br>\r\n8. Medical Waster Facility with Autoclave for Infectious Waste</br>\r\n\r\nFor inquiries, you may reach us through our phone number (072)888-5501 or email us at neda1pmed@gmail.com.','.',1,2016),(26867,'This is to acknowledge receipt of the 8 projects enrolled in the CY 2016 Online Project Monitoring and Evaluation System</br>\r\ncomprised of 6 infrastructure and 2 social development projects.','.',1,2016),(11343,'This is to acknowledge receipt of Four (4) projects enrolled in the CY 2016 Online Regional Project Monitoring and Evaluation System\r\n<br/>Please adjust the Financial Target to Actual amount for the Four projects enrolled, namely: 1)Tourism Manpower Skills Training, 2) Tourism Awareness/IEC Activities, 3) Product Development (Market and Product Development), 4) Tourism Development Planning.','.',1,2016),(11261,'For feedback to the RPMC during its CY 2016 Second Regular Meeting','.',1,2016),(24720,'This is to acknowledge receipt of the 4 projects enrolled in the CY 2016 Online Regional Project Monitoring and\r\nEvaluation System under the Trade, Industry and Tourism Sector.','.',1,2016),(22983,NULL,NULL,0,2016);

