additional cash advances.',NULL),(24181,NULL,NULL,NULL,NULL,NULL,'Delayed implementation of the Social Pension Program or the Monthly Stipend for Older Person thru door-to-door delivery scheme. \r\n\r\nOn the five-year implementation of the program, it has encountered several issues and gaps such as the release of stipend to the beneficiaries through cash payout which poses risk both to the personnel and beneficiaries, absence of some social pensioners on scheduled cash payouts due to their physical condition and geographical locations, and limited manpower which causes delay in the distribution of stipends. With this, it was seen that there is a need to try other modes of payment that would address such concerns. \r\n\r\nAs such DSWD FO1 has explored other mode of payment such as the door-to-door delivery scheme though a service provider, the Philippine Postal Corporation (PhilPost). 39,464 beneficiaries or 61 LGUs amounting to P59,196,000.00 were targeted for the said scheme effective 1st quarter CY 2016. The PhilPost took more than a month in the distribution of stipend consideringthe nature or mode of payment, lack of manpower, geographical locations and number of beneficiaries. \r\n\r\nout of the 61 LGUs targeted for door-to-door delivery scheme, the said service provider has only submitted the liquidation reports for the 37 LGUs as of the reporting date. The funds for the succeeding quarters can only be downloaded to the service provider once the previous funds transferred to them are fully liquidated. \r\n\r\nhence, the delay in the implementation of the program. ','2016-08-09 13:57:00',NULL,NULL,'David Milo Rabelas, statistician 1','The Program has encountered several issues and gaps on its five-year implementation such as the release of stipend to the beneficiaries through cash payout which poses risk both to the personnel and beneficiaries, absence of some social pensioners on scheduled cash payouts due to their physical conditions and geographical locations, and limited manpower which causes delay in the distribution of stipends.  With this, it was seen that there is a need to try other modes of payment that would address such concerns. \r\n\r\nAs such, the DSWD FO I has explored other mode of payment such as the Door-to-Door Delivery Scheme thru a service provider, the Philippine Postal Corporation (PhilPost). 39,464 beneficiaries or 61 LGUs amounting to P59,196,000.00 were targeted for the said scheme effective 1st quarter CY 2016. Considering the nature or mode of payment, lack of manpower, geographical locations, and number of the beneficiaries targeted, the Philippine Postal Corporation took almost two (2) months in the distribution of stipend for the 1st quarter 2016 and more or less three (3) months to complete the liquidation reports. Hence, the delayed implementation. Due to the long waiting period to distribute the stipend thru this mode of payment, there are beneficiaries who already died before the payout date. DSWD Memorandum Circular No. 17 series of 2015 entitled, Amendment to the Provisions in the Guidelines on the Implementation of Social Pension for Indigent Senior Citizens, states that \"in case the beneficiary died during the 1st month of the quarter before the scheduled payout, the full amount of the unclaimed stipend shall be given to the replacement beneficiary\". As a result, the deceased beneficiary will not be able to receive his/her stipend.                                                                                                                                                                 A series of dialogue was conducted by the FO with the PhilPost to resolve issues and concerns encountered in the implementation of the said scheme.  It was suggested that the Philippine Postal Corporation should outsource manpower to do the distribution of stipend in order to fast track the payment and liquidation. The payout for the 2nd to 4th quarters CY 2016 for the 32 targeted LGUs under the door-to-door delivery scheme is being conducted simultaneously.\r\n','2016-12-01 13:00:00','2016-12-01 12:11:00','David Milo Rabelas, statistician 1','David Milo Rabelas, statistician 1',NULL,NULL,NULL,NULL,NULL,NULL,'The Philippine Postal Corporation should outsource manpower to the distribution of stipend in order to fast track the payment and liquidation. \r\n\r\nThe payout for the 2nd and 3rd quarters CY 2016 for this scheme should be conducted simultaneously. ','For the Door-to-Door Delivery Scheme: Distribution of  stipend until 15 December 2016, and  Deadline of the submission of liquidation reports for the 2nd-4th quarters CY 2016 until 15 January 2017                          ',NULL),(24525,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL),(353,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'Not yet started.','2016-10-19 14:54:00','2016-10-19 14:48:00','Remelyn Viste Almodovar, Project Monitor','Remelyn Viste Almodovar, Project Monitor',NULL,NULL,NULL,NULL,NULL,NULL,NULL,'For bidding this 4th Quarter.',NULL),(10650,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL),(12117,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL),(15722,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'Not yet started.','2016-10-19 14:54:00','2016-10-19 14:48:00','Remelyn Viste Almodovar, Project Monitor','Remelyn Viste Almodovar, Project Monitor',NULL,NULL,NULL,NULL,NULL,NULL,NULL,'For awarding. (MR to be resolved by UBAC)',NULL),(21638,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'Not yet started.','2016-10-19 14:54:00','2016-10-19 14:48:00','Remelyn Viste Almodovar, Project Monitor','Remelyn Viste Almodovar, Project Monitor',NULL,NULL,NULL,NULL,NULL,NULL,NULL,'For bidding this 4th Quarter.',NULL),(25032,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'Delayed 