ation imposed by RA 10023 (IRR DAO 2010-12)\r\na) 250 sq.m. for urban areas\r\nb) 500 sq.m. for cities\r\nc) 750 sq.m. for 1st class/2nd class LGUs\r\nd) 1000 sq.m. for other municipalities\r\nHence, the lots need to be subdivided among the heirs/owners in order to enable lot claimants to apply for Residential Free Patents\r\n\r\n- Some LGUs/municipalities in Ilocos Sur has no approved Comprehensive Land Use Plan (CLUP) or Zoning Ordinance classifying areas as Residential Zones/Areas hence the LGUs must classify lots zone as residential or actual use as mixed use (commercial/industrial)','2016-11-21 14:49:00','2016-11-16 19:27:00','Armand Ruel Llarenas Estigoy, AA 1','Ednore Freynon Nuval Perez, Sr. EDS',NULL,NULL,NULL,NULL,NULL,NULL,NULL,'- The Regional Office has established a fast lane for government surveys and fastrack verification and approval of subdivision survey plans for residential lands\r\n\r\n- The PENROs/CENROs coordinated with the LGUs Provincial/Cities/Municipalities/Barangays, regarding intensified IEC Program through Provincial Caravan on DENR Program/Projects in coordination with land owners/NGOs/NGAs and other concerned stakeholders\r\n\r\n- The requirements for the application of Residential Free Patent has been streamlined in accordance with RA 10023 & DENR Admin Order 2010-12.  Ex. the mix-use of residential lots, the actual use of the applied lots.',NULL),(1847,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL),(3911,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL),(7559,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL),(8717,'Preliminary activities were already undertaken for the preparation of PA management plan of Agoo-Damortis Protected Landscape.  This included PAMB meeting for the creation of TWG in line with e preparation of t